import React, { useState } from 'react';

const Contact = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    message: '',
  });

  const [errors, setErrors] = useState({});

  const validateForm = () => {
    const newErrors = {};
    if (!formData.name) newErrors.name = 'Name is required';
    if (!formData.email) {
      newErrors.email = 'Email is required';
    } else if (!/\S+@\S+\.\S+/.test(formData.email)) {
      newErrors.email = 'Email address is invalid';
    }
    if (!formData.phone) {
      newErrors.phone = 'Phone number is required';
    } else if (!/^\d{10}$/.test(formData.phone)) {
      newErrors.phone = 'Phone number is invalid';
    }
    if (!formData.message) newErrors.message = 'Message is required';

    return newErrors;
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const validationErrors = validateForm();
    if (Object.keys(validationErrors).length === 0) {
      // Form is valid, proceed with form submission (e.g., send data to server)
      console.log('Form submitted successfully', formData);
    } else {
      setErrors(validationErrors);
    }
  };

  return (
    <section id='contact' className="py-16 bg-gradient-to-r from-cyan-500 to-blue-500">
      <h2 className='mb-8 text-4xl text-white text-center font-semibold'>Contact <span className='text-white'>Me</span></h2>
      <div className="container mx-auto px-4">
        <div className="py-8 lg:py-16 px-4 mx-auto max-w-screen-md bg-white mb-4 rounded-md shadow-lg">
          <p className="mb-8 lg:mb-16 font-light text-center text-gray-500 sm:text-xl"></p>
          <form onSubmit={handleSubmit} className="space-y-8">
            <div>
              <label htmlFor="name" className="block mb-2 text-sm font-medium text-cyan-700">Your name</label>
              <input
                type="text"
                id="name"
                name='name'
                className={`shadow-sm bg-gray-50 border ${errors.name ? 'border-red-500' : 'border-gray-300'} text-gray-900 text-sm rounded-lg focus:ring-cyan-500 focus:border-cyan-500 block w-full p-2.5 outline-0`}
                placeholder="Your Name"
                value={formData.name}
                onChange={handleChange}
              />
              {errors.name && <p className="text-red-500 text-xs mt-1">{errors.name}</p>}
            </div>
            <div>
              <label htmlFor="email" className="block mb-2 text-sm font-medium text-cyan-700">Your email</label>
              <input
                type="email"
                id="email"
                name='email'
                className={`shadow-sm bg-gray-50 border ${errors.email ? 'border-red-500' : 'border-gray-300'} text-gray-900 text-sm rounded-lg focus:ring-cyan-500 focus:border-cyan-500 block w-full p-2.5 outline-0`}
                placeholder="Your Email"
                value={formData.email}
                onChange={handleChange}
              />
              {errors.email && <p className="text-red-500 text-xs mt-1">{errors.email}</p>}
            </div>
            <div>
              <label htmlFor="phone" className="block mb-2 text-sm font-medium text-cyan-700">Phone no.</label>
              <input
                type="tel"
                id="phone"
                name="phone"
                className={`shadow-sm bg-gray-50 border ${errors.phone ? 'border-red-500' : 'border-gray-300'} text-gray-900 text-sm rounded-lg focus:ring-cyan-500 focus:border-cyan-500 block w-full p-2.5 outline-0`}
                placeholder="Your Phone no."
                value={formData.phone}
                onChange={handleChange}
              />
              {errors.phone && <p className="text-red-500 text-xs mt-1">{errors.phone}</p>}
            </div>
            <div className="sm:col-span-2">
              <label htmlFor="message" className="block mb-2 text-sm font-medium text-cyan-700">Your message</label>
              <textarea
                id="message"
                name="message"
                rows="6"
                className={`shadow-sm bg-gray-50 border ${errors.message ? 'border-red-500' : 'border-gray-300'} text-gray-900 text-sm rounded-lg focus:ring-cyan-500 focus:border-cyan-500 block w-full p-2.5 outline-0`}
                placeholder="Leave a comment..."
                value={formData.message}
                onChange={handleChange}
              ></textarea>
              {errors.message && <p className="text-red-500 text-xs mt-1">{errors.message}</p>}
            </div>
            <button
              type="submit"
              className="py-3 px-5 text-sm font-medium text-center text-white rounded-lg bg-cyan-700 sm:w-fit hover:bg-cyan-600 focus:ring-4 focus:outline-none focus:ring-cyan-300"
            >
              Send message
            </button>
          </form>
        </div>
      </div>
    </section>
  );
}

export default Contact;
